import { Text, StyleSheet, View, Image } from "react-native";
import { COLORS, SIZES, images } from "../../constants";

import Spacer from "../../components/Spacer/spacer";
import Background from "../../components/Image/Background";
import SearchIcon from "../../components/Search/SearchIcon";
export default function Discover() {
  const data = [
    { id: 1, image: images.Image1, text: "Text 1" },
    { id: 2, image: images.Image2, text: "Text 2" },
    { id: 3, image: images.Image3, text: "Text 3" },
    { id: 4, image: images.Image4, text: "Text 4" },
  ];

  return (
    <View style={styles.container}>
      {/* Background Component */}
      <Background src={images.Background} style={styles.backgroundImage} />

      <Spacer vertical={20} horizontal={60}>
        <View style={styles.header}>
          <Text style={styles.Headline}>Discover</Text>
          <SearchIcon />
        </View>
      </Spacer>
    </View>
  );
}

const styles = StyleSheet.create({
  header: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
  },
  container: {
    flex: 1,
    width: "100%",
    height: "100%",
    position: "relative",
  },
  backgroundImage: {
    flex: 1,
    resizeMode: "cover",
    position: "absolute",
    width: "100%",
    height: "100%",
  },
  Headline: {
    fontSize: SIZES.xxLarge,
    color: COLORS.fontColour,
  },
});
